INSERT INTO `datacollector_task` VALUES (1,'vocabulary','Vocabulary','Please provide a definition for the word(s) displayed on your screen.','After the beep, please say the definition for #WORD#.',6,10,0,0,0,1),(2,'image_naming','Image Naming','Please write the name for each of the following objects.',NULL,6,20,0,0,0,1),(3,'word_recall','Word Recall','You will be shown a list of words (all nouns). Try to remember them; take as long as you need. On the following page, you will be asked to write them down from memory. ',NULL,10,30,0,0,0,0),(4,'delayed_word_recall','Delayed Word Recall','You will be shown a list of words (nouns). Try to remember them; take as long as you need to. At some point later during the session, you will be asked to recall them from memory and write down as many as you remember. ',NULL,10,40,0,0,0,0),(5,'word_recognition','Word Recognition','Below is a list of words (nouns). Try to remember them; take as long as you need to. On the following page, you will be shown these words mixed with new ones and you will be asked to identify the original set of words.',NULL,10,50,0,0,0,0),(6,'language_intelligibility','Language Intelligibility ','Please press the \"record\" button and read out loud the sentence shown on the screen. When done, press \"stop recording\".',NULL,5,60,0,0,0,0),(7,'picture_description','Picture Description','Below you see a picture of a scene. Please press the \"Start recording\" button (below the image) and, in your own words, describe what you see in the most detail you can. Try to talk for at least a minute. When done, press \"Stop recording\", and then \"Submit\".',NULL,1,70,0,0,0,1),(8,'sentence_completion','Sentence Completion','Below are some sentences with missing words. Complete each blank with the word you feel fits the best.',NULL,5,80,0,0,0,0),(9,'creative_writing','Creative Writing','Below is a picture depicting a scene. Please use the space beneath it to write a short story, in your own words, about what is going on in the scene and why. Try to write at least a short paragraph. Be as creative as you want.',NULL,1,90,0,0,0,0),(10,'story_recall','Story Recall','Below is a passage from a story. Please read it and try to remember the details. On the next page, you will be asked to verbally retell the story in your own words.','You will hear a story. After the beep please retell the story in your own words. Starting story. #STORY#',1,100,0,0,0,1),(11,'winograd','Winograd Schemas','Read each sentence, and answer the question by selecting one of the options.','You will hear a sentence, followed by a question with two possible answers. After you hear those answers, please select the answer number by pressing one or two. Starting sentence. #SENTENCE#. Here are your options #OPTIONS#',5,25,0,0,0,1),(12,'rig','Random Item Generation','In this section you will be asked to come up with series of random items (e.g., numbers, letters, etc). Please follow the instructions below.','After the beep, please say as many different items of type #ITEM# that come to mind randomly.',1,55,0,0,0,1),(13,'general_disposition','General Disposition','Previous research has shown an association between mood and cognitive performance on verbal and non-verbal tasks, including verbal fluency, verbal learning, and reaction time. Please estimate your current mood, below.','A person’s mood can have a slight effect on how they speak. Could you please tell us a little bit about how you’re feeling today, by ranking your mood from 0 (very sad) to 9 (completely ecstatic)? Please press the number that applies.',NULL,1,1,0,0,1),(14,'sentence_reordering','Phrase Reordering','Below are some sentences whose clauses may have been scrambled out of order. Please press the \"Start recording\" button, and read each sentence out loud, in the correct clause order. When done, press \"Stop recording\".',NULL,3,110,0,0,0,0),(15,'stroop','Stroop Interference','When you click \"Start\", you will be shown a series of words printed in different colours. You need to name the colour in which the word appears. For example, if the word \"green\" is shown in red colour, you need to say \"red\". Click the \"Next\" button to move onto the next word in the series.',NULL,18,5,0,0,0,1),(16,'reading_fluency','I can read out loud','Here are some stories for you to read out loud. Please read each story clearly and at a comfortable speed. Your reading will be recorded. Are you ready? Click \"Show me the story.\"',NULL,8,1,1,0,0,0),(17,'picture_description_oise','I can describe pictures.','In this task you will see some pictures. Describe what is happening in the pictures. Try to use full sentences when you describe the pictures. Your voice will be recorded.\n\nClick \"Next\" when you are ready.',NULL,3,20,1,0,0,0),(18,'story_retelling_oise','I can retell the story I heard or read.','In this task, you will hear or read a story. After you finish, please tell the story again. Try to retell it with as many details as you can!\n\nAre you ready? Click \"Next.\"',NULL,2,30,1,0,0,0),(19,'word_map_oise','I can create a word map','In this task you will make a word map.  A word map is a diagram where you connect words to each other based on their meaning. Connected words can have the same meaning or opposite meanings.\n\nWhen you double-click on the word, you will see a new page to create a word map. Take a look at this quick video to learn how!',NULL,10,50,1,0,0,0),(20,'puzzle_solving_oise','I can solve puzzles','Here are some puzzles. Solve each one by choosing the best match for the pattern. Are you ready?',NULL,4,100,1,0,0,0),(21,'word_recall_oise','I can remember lists of words.','You will hear a list of words. After you hear the words, say out loud as many words as you can remember.\n\nYou can say them in any order. Try to remember as many words as you can!\n\nAre you ready? Click \"I\'m ready for the words.\"\n',NULL,NULL,60,1,0,0,0),(22,'word_sounds_oise','I can say words without certain sounds.','A word will be said aloud to you. Please say it out loud. Then, you will be asked to remove a sound from the word. Say it again with that sound missing. Let\'s start with an example. \n\n\nAre you ready? Click \"Next\" to get started.',NULL,NULL,40,1,0,0,0);
