INSERT INTO `datacollector_task_field_value` VALUES (13,16,'The grass is [BLANK].',NULL,1,NULL,'green'),(14,16,'Sugar is [BLANK].',NULL,1,NULL,'sweet,white'),(15,16,'Roses are red, violets are [BLANK].',NULL,1,NULL,'blue'),(16,16,'They fought like cats and [BLANK].',NULL,1,NULL,'dogs'),(17,16,'Christmas is in the month of [BLANK].',NULL,1,NULL,'December'),(18,16,'Nurses work in a [BLANK].',NULL,1,NULL,'hospital'),(19,16,'You can buy stamps at the [BLANK].',NULL,1,NULL,'post office,variety store'),(20,16,'There are [BLANK] days in a week.',NULL,1,NULL,'seven,7'),(21,16,'Snow is the colour [BLANK].',NULL,1,NULL,'white'),(22,16,'The rain is [BLANK].',NULL,1,NULL,'wet'),(23,16,'A soldier carries a [BLANK].',NULL,1,NULL,'gun'),(24,20,'My Grandfather\r\n\r\nYou wish to know all about my grandfather.  Well, he is nearly 93 years old, yet he still thinks as swiftly as ever.  He dresses himself in an ancient, black frock coat, usually minus several buttons.\r\n\r\nA long, flowing beard clings to his chin, giving those who observe him a pronounced feeling of the utmost respect.  When he speaks his voice is just a bit cracked and quivers a trifle.  Twice each day he plays skillfully and with zest upon a small organ.\r\n\r\nExcept in the winter when the snow or ice prevents, he slowly takes a short walk in the open air each day. We have often urged him to walk more and smoke less but he always answers, \"Banana oil!\"  Grandfather likes to be modern in his language. ',NULL,2,NULL,NULL),(25,20,'The Rainbow\r\n\r\nWhen the sunlight strikes raindrops in the air, they act like a prism and form a rainbow.  A rainbow is the division of white light into many beautiful colors.  These take the shape of a large, round arch, with its path high above and its two ends apparently beyond the horizon.\r\n\r\nThere is, according to legend, a boiling pot of gold at one end.  People look but no one ever finds it.  When a man looks for something beyond his reach, his friends say he is looking for the pot of gold at the end of the rainbow. ',NULL,3,NULL,NULL),(26,20,'Limpy\r\n\r\nLimpy is a fuzzy, yellow, baby duck.  He belongs to a fisherman.  The fisherman lives in a little house by the bay.  Every morning children go swimming in the bay.  About 10:00, Limpy waddles out to the road to wait for the children.  When he hears them coming he begins a loud, excited quacking.\r\n\r\nThe children always bring bread or corn for Limpy.  He will nip at their fingers or peck at their bare toes until he is fed.  Limpy never follows the children down to the shore.  He likes to swim in his own little pond.  It is much safer. ',NULL,1,NULL,NULL),(27,12,'bed',NULL,1,NULL,NULL),(28,12,'nose',NULL,1,NULL,NULL),(29,12,'pipe',NULL,1,NULL,NULL),(30,12,'window',NULL,1,NULL,NULL),(31,12,'banana',NULL,1,NULL,NULL),(32,12,'snowball',NULL,1,NULL,NULL),(33,12,'forty-five',NULL,2,NULL,NULL),(34,12,'ninety-five percent',NULL,2,NULL,NULL),(35,12,'sixty-two and a half',NULL,2,NULL,NULL),(36,12,'The telephone is ringing.',NULL,3,NULL,NULL),(37,12,'He is not coming back.',NULL,3,NULL,NULL),(38,12,'The pastry cook was elated.',NULL,3,NULL,NULL),(39,12,'First British Field Artillery',NULL,3,NULL,NULL),(40,12,'No ifs, ands or buts.',NULL,3,NULL,NULL),(41,12,'Pack my box with five dozen jugs of liquid veneer.',NULL,3,NULL,NULL),(42,5,'cup',NULL,1,NULL,NULL),(43,5,'matches',NULL,1,NULL,NULL),(44,5,'pencil',NULL,1,NULL,NULL),(45,5,'flower',NULL,1,NULL,NULL),(46,5,'comb',NULL,1,NULL,NULL),(47,5,'screwdriver',NULL,1,NULL,NULL),(48,5,'window',NULL,1,NULL,NULL),(49,5,'chair',NULL,1,NULL,NULL),(50,5,'desk',NULL,1,NULL,NULL),(51,5,'light',NULL,1,NULL,NULL),(52,5,'door',NULL,1,NULL,NULL),(53,5,'ceiling',NULL,1,NULL,NULL),(65,14,'cookietheft.jpg',NULL,2,NULL,NULL),(66,18,'picnic.png',NULL,3,NULL,NULL),(615,22,'The city councilmen refused the demonstrators a permit because they feared violence. Who feared violence?',NULL,1,616,'the_city_councilmen'),(616,22,'The city councilmen refused the demonstrators a