inutes.\"',NULL,1,NULL,NULL),(5338,34,'Cora and her baby brother Theo are playing in the snow. Although it\'s chilly, the bright sun feels like it\'s already spring. As Cora pushes Theo\'s sled to the top of the hill, she smiles. He looks exactly like a bear in his furry snowsuit!\n\nTheo laughs, and then - surprise! - he rolls off the sled and starts sliding down the hill. He quickly gains speed over a steep, icy section. Racing after him, Cora sees someone appear at the bottom of the hill. With care, her mother scoops up her speeding son. Standing up, she laughs, \"No broken bones on this little bear! Now, let\'s go inside and have lunch.\"',NULL,2,NULL,NULL),(5339,34,'\"Science tutoring begins in 10 minutes,\" said Mr. Taylor as the bell rang. My friend Ying and I exchanged glances, stood up, and trailed our teacher toward his office.\n\nI knocked on his door. \"Excuse me?\" I ventured. \"We\'re in an awkward position. Our volleyball coach entered us into a major tournament... in just eight days! We\'d like to come for tutoring, but we can\'t miss practice. Would you consider meeting before school?\"\n\n\"We need help with the oxygen molecules,\" Ying added.\n\nMr. Taylor leaned back in his chair. \"That\'s a good solution. Let\'s begin tomorrow with Chapter 7, especially the compounds table with the underlined vocabulary.\"\n\nHe leaned forward, adding, \"I\'ll bring doughnuts to make our early morning easier.\" Ying and I grinned, thanked Mr. Taylor, and headed out the door.\n\n\"That went better than expected!\" I beamed.',NULL,3,NULL,NULL),(5340,36,'Which work did Anton do first in this story?',NULL,1,NULL,NULL),(5341,37,'math','Math',1,5340,NULL),(5342,37,'science','Science',1,5340,NULL),(5343,37,'english','English',1,5340,NULL),(5344,37,'history','History',1,5340,NULL),(5345,36,'Why did Cora stop running after her brother?',NULL,1,NULL,NULL),(5346,37,'caught_by_mother','He was caught by their mother',1,5345,NULL),(5347,37,'stopped_sliding','He stopped sliding and stood up.',1,5345,NULL),(5348,37,'started_crying','He started crying.',1,5345,NULL),(5349,37,'bumped_into_tree','He bumped into a tree.',1,5345,NULL),(5350,36,'What is probably true about Cora and Theo\'s mother?',NULL,1,NULL,NULL),(5351,37,'worried_about_safety','She is worried about her son\'s safety.',1,5350,NULL),(5352,37,'busy_with_responsibilities','She is very busy with her responsibilities.',1,5350,NULL),(5353,37,'upset','She is upset about what happened.',1,5350,NULL),(5354,37,'sense_of_humor','She has a good sense of humor.',1,5350,NULL),(5355,36,'Why were the girls nervous about talking to their teacher?',NULL,1,NULL,NULL),(5356,37,'no_volleyball','They thought he didn\'t want them to play volleyball.',1,5355,NULL),(5357,37,'no_help','They were worried he wouldn\'t be able to help them.',1,5355,NULL),(5358,37,'bad_marks','They were worried they would get bad marks in science.',1,5355,NULL),(5359,37,'school_absence','They needed to be absent from school for a tournament.',1,5355,NULL),(5360,36,'What is probably true about Mr. Taylor?',NULL,1,NULL,NULL),(5361,37,'intimidating','Students tend to think that he\'s intimidating.',1,5360,NULL),(5362,37,'high_expectations','He has high expectations for his students.',1,5360,NULL),(5363,37,'not_dedicated','He is not completely dedicated to his work.',1,5360,NULL),(5364,37,'easygoing','Students believe he is generally easygoing.',1,5360,NULL),(5365,38,'oise/PD_stimulus_1.png',NULL,1,NULL,NULL),(5366,38,'oise/PD_stimulus_2.png',NULL,1,NULL,NULL),(5367,40,'StoryRecall_Audio_MaleFinal.MP3',NULL,1,NULL,NULL),(5368,40,'story_recall/crow.MP3',NULL,1,NULL,NULL),(5369,42,'It was afternoon recess, and Pablo, who was in the fifth grade, was running a race with his friend Ariana across the school yard. They were preparing for the school track and field tryouts to be held the following week. Even though it was a cold winter day, they were determined to practice so that they could make it on the team. It was very prestigious to be on the track and field team in their school.\n\nJust as Pablo was going to cross the finish line, he saw a huge figure blocking his way. He stopped abruptly. It was Mack, the school bully, and he did not look happy. Mack always picked on Pablo at recess. Although they were in the same grade, Mack was much taller and stronger than Pablo. Pablo felt his heart pounding as Mack blocked his path, an ugly sneer on his face. Mack growled, \"Get out of my way, loser.\" Pablo tried to speak, but as usual, the words somehow wouldn\'t come out. He was too frightened to reply to Mack.\n\nJust then, Ariana stepped right up to Mack and said \"He\'s no loser, he\'s my friend! Just leave us alone and let us race.\" Mack looked surprised as the small girl stood in front of him. Pablo felt stronger with his friend by his side, and said boldly, \"Do you want to race with us? We are practicing for the track and field tryout.\" After a long pause, Mack murmured, \"I\'ve always wanted to be on the track team but I\'ve been too nervous to try.\" Then, Pablo, Ariana, and Mack raced against each other in the school yard until the bell rang, signaling the end of recess. They became friends and practiced every day at recess.\n\nA week later, all three made the team.',NULL,3,NULL,NULL),(5380,47,'oise/puzzles/Puzzle1.png',NULL,1,NULL,NULL),(5381,48,'/path/to/image/choices',NULL,1,NULL,NULL),(5382,49,'a','oise/puzzles/Puzzle1_A.JPG',1,5380,NULL),(5383,49,'b','oise/puzzles/Puzzle1_B.JPG',1,5380,NULL),(5384,49,'c','oise/puzzles/Puzzle1_C.JPG',1,5380,NULL),(5385,49,'d','oise/puzzles/Puzzle1_D.JPG',1,5380,NULL),(5386,49,'e','oise/puzzles/Puzzle1_E.JPG',1,5380,NULL),(5387,49,'f','oise/puzzles/Puzzle1_F.JPG',1,5380,NULL),(5388,47,'oise/puzzles/Puzzle2.JPG',NULL,1,NULL,NULL),(5389,48,'/path/to/image/choices',NULL,1,NULL,NULL),(5390,49,'a','oise/puzzles/Puzzle2_A.JPG',1,5388,NULL),(5391,49,'b','oise/puzzles/Puzzle2_B.JPG',1,5388,NULL),(5392,49,'c','oise/puzzles/Puzzle2_C.JPG',1,5388,NULL),(53